// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;

contract Calculator{
    function multiply (uint x,uint y) external pure returns(uint){
        return x*y;
    } 

        function divide (uint x,uint y) external pure returns(uint){
        require(y!=0);
        uint precision = 10**2;
        return (x*precision)/y;
    } 
}

